# Law-Psychology Research in the U.S. {background-image="images/uslawpsych.png" background-opacity="0.2"}


::: {.cell}

:::

::: {.cell}

:::


## Plan for today {.inverse}

::: columns
::: {.column width="60%"}
![](images/pl40_paper.png)
:::

::: {.column width="40%"}
![](images/lindeve.png) ![](images/brank_lab.jpg)
:::
:::

::: notes
Hello. My name is Emma Marshall and I am a graduate student at the University of Nebraska-Lincoln.

Today I am going to talk to you about the research that is conducted and published in the US in the field of law-psychology. To do this, I am going to spend most of my time focusing on a content analysis that Dr. Eve Brank (who you met earlier this week) and her other graduate student did a few years ago. You can see what the entire crew looks like here-- the upper picture features Dr. Brank and the primary author on this paper, Dr. Lindsey Wiley at her phD graduation ceremony. In the bottom picture you will see what all of us look like after running a half marathon together! From left to right you will find the other authors of this paper-- Joshua Haby (who is very close to finishing his PhD), Dr. Lori Hoetger and Dr. Katherine Hazen. That last extremely tired looking person is me--who isn't technically an author on this paper because it was finished around the time I first arrived at Nebraska.

But I am very familiar with the data and will be walking you through many of the findings using the pronoun 'we' for the sake of simplicity. But when I say 'we' I am generally referring to the hard work that these fine folks put into reviewing the articles in the field-- or more specifically-- the articles published within the first 40 years of the flagship law-psychology journal and official journal of the American Psychology-Law Society--Law and Human Behavior.
:::

## Previous Research Reviews

::: incremental
> [Selective reviews with narrow focus]{.rn}

-   Experimental forensic psychology [Moore & Finn (1986)](https://pubmed.ncbi.nlm.nih.gov/3745469/)

-   Jury decision making [Devine et al (2000)](https://www.researchgate.net/publication/228688698_Jury_Decision_Making_45_Years_of_Empirical_Research_On_Deliberating_Groups)

-   Cross race effect [Meissner & Brigham (2001)](https://psycnet.apa.org/record/2001-14540-001)
:::

::: notes
This paper was the first of its kind. Most previous review papers in the field of law-psychology have focused on a specific topic or sub-area of research within the field. But the terminology and use of overlapping terms can sometimes make this appear otherwise. For example, this review conducted by Moore and Finn in 1986 used the terminology experimental forensic psychology--but they focused on applications of the clinical psychology and forensic practice within the law.
:::

## Scientific Review Papers

::: incremental
> [Approved by AP-LS committee]{.rn}

-   Eyewitness Identification Procedures: Recommendations for lineups and Photospreads [Wells et al (1998)](https://psycnet.apa.org/fulltext/2020-06220-002.html)

-   Police-induced Confessions: Risk Factors and Recommendations [Kassin et al (2010)](https://psycnet.apa.org/record/2010-02823-002)

-   Policy and Procedure Recommendations for the Collection and Preservation of Eyewitness Identification Evidence [Constanzo & Levett (2020)](https://psycnet.apa.org/fulltext/2020-06220-001.html)
:::

::: notes
The other major review papers have been conducted through a different kind of process outlined by the American Psychology-Law Society (which is the main professional organization for law-psychology researchers and practitioners in the US and I think Dr. Brank or Dr. Cox already talked about). But what is notable about these official scientific review papers is that they were approved by a committee of AP-LS experts and are meant to objectively summarize the research literature in areas where there is a high degree of scientific clarity and consensus.

So far, there have only been three papers approved since this committee was established in the late 1990's. But as you might notice, these papers only focus on two different topics: eyewitnesses and police induced confessions. What is important to understand about these review papers is that while eyewitness memory issues and coercive police practices are not problems that are unique to the U.S. -- the particular policies and procedures that experts are recommending are largely shaped by the particularities of the U.S. constitutions approach to criminal procedure. Specifically as it relates to the rights of criminal defendants in our system.

As Dr. Cox talked about in an earlier lecture, this focus on issues related to policing and the criminal law makes sense within the context of the history of policing and the moment towards using incarceration as a means of controlling marginalized populations following the civil rights movement.

But the field of law-psychology research--as we will discover from looking at the range of articles published in Law & Human Behavior over the last 40 years-- extends far beyond these topics to other areas within criminal law and even to the civil law system.

So before we jump into the data it is worth taking a step back and clarifying a few important aspects of the legal system in the United States. As I understand it, Dr. Cox may have already touched on some of these issues so I do not plan to go into much detail. But in order to understand the full scope of law-psychology research in the U.S. it is worth clarifying a few oddities within our system that have inevitably shaped the types of research that is conducted here.
:::

## Sources of Law in the U.S.

::: columns
::: {.column width="50%"}
Civil Law ![](images/civil.jpg)
:::

::: {.column width="50%"}
Criminal Law

![](images/jail.png)
:::
:::

::: notes
::: notes
One thing that is important to keep in mind about the U.S. legal system is that there are many different sources or types of law that researchers may want to investigate.

Our laws reflect what is often called a hybrid-system: sometimes we act like a common law or judge/precedent based system and other times we write our laws down in civil law-style codes or statutes. Again, my understanding of the Columbian legal system is limited but I believe that you primary have a civil law based system. Meaning that laws are primarily written down in codes or statutes. And again, we also have that here in the U.S., but there are also many other sources of law; including areas where the rules and regulations are made by the courts and judges based on legal precedent or executive agencies rather than legislators.

One reason why I mention this is that some of the terminology we use to describe US system can be confusing ased on their overlapping meaning. For instance, when we talk about their being a distinction between the civil law and criminal law SYSTEMS in the US... the term civil law doesn't just refer to the fact that the laws are based on a code or statutes written down by the legislature (although often they are). In this context, the civil law system generally refers to the laws and courts in the U.S. that deal directly with disputes that arise between 'people.'instead the civil law system in the U.S. refers to the laws and courts that deal directly with the disputes that arise between the 'people.'

Things like family courts for divorce and child custody. Resolving property disputes between neighbors over the location of a fence. Employment lawsuits and contracts between businesses -- generally speaking--all of this falls under the category of the "civil law" in our system.

This system of civil laws is different from our system of 'criminal laws' that generally refer to situations where the government is seeking to punish someone for their conduct. Again, I am over-simplifying things here, but typically when the government is a party in a case or controversy--it is a matter of criminal law.

Additionally, just to be clear, while the civil and criminal laws systems are the most well-known and studied, but there is also a separate body of law referred to as administrative law that is governed by an entirely different set of rules and procedures. And as Dr. Cox mentioned there are also many specialized bodies of laws and courts that deal with juveniles or other special issues like immigration that operates outside of the traditional criminal and civil law systems.

Law-psychology researchers in the U.S. include people with varying level of familiarity with the complexities of these systems. As Dr. Brank talked about earlier this week, the quirks of the legal system and practice of law in the U.S. is one reason why joint law and psychology programs exist. And given that the many differences between the civil and criminal systems matter a lot in terms of what law gets applies and who gets to make what decisions in what contexts--they also influence the type of law-psychology research that is conducted.
:::
:::

## Law in the U.S.

### State vs Federal Law


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-revealjs/unnamed-chunk-3-1.png){width=960}
:::
:::


::: notes
Another structural feature of the U.S legal system that impacts law-psychology research here in U.S. is the unique division of power that exists between our federal government and the government of individual states. The 'law' in the U.S. is really best understand as a interconnected web of many different mini-legal systems that are run by semi-autonomous governments that are not required to listen to each other--but occasionally have to do what the federal government says.

To make things more complicated we have also further divided our federal court system into 13 different 'circuit courts' or regions. These regions look mostly the same today as they did when they were first established in the late 19th century. Except based on the boundaries that made sense when they were first established back in the late 19th century except for: the 10th circuit which used to be part of the 8th circuit and the 11th circuit which used to be part of the 5th circuit. Before they got too big to manage.

This means that the the meaning of the 'law' or the 'U.S. constitution' can vary significantly from colored region to colored region for long periods of time. Until such point at which our Supreme Court (which consists of 9 individuals with life-tenure) can (but only if they want to) weigh in to resolve the dispute. Something to keep in mind about that is very important to remember when you talk about the U.S. legal system is that many of its structures and features are based on what life was like in the late 19th century and therefore makes little to no logical sense to someone viewing the system today.

The primary reason for all this is that the U.S. constitution--which has been mostly unchanged for the last 230 years except for a brief period directly following a civil war--established a federal government with limited powers and reserved a lot of the law-making authority to the states.

As I understand it, and someone please correct me if I am wrong, but Colombia's much more recent constitution is also divided into smaller territories that are somewhat like our "States"-- but they don't have their own separate legislatures or court systems. And most of the power to make laws and enforce those laws is given to the central, federal government.

But that is not how it works in the U.S. (for better or worse). Instead, each state has the authority to run its own little separate and partially independent legal system that can vary greatly from its next door neighbor. This vertical division of power between the federal government and the individual states is commonly referred to as the U.S. system of Federalism.
:::

## State vs Federal Law {background-image="images/constitution.jpg" background-opacity="0.2"}

::: r-stack
![](images/fedstate.png){.fragment width="400"}

![](images/judge.png){.fragment width="450"}

![](images/bill.jpg){.fragment width="400"}
:::

::: notes
One reason why this idea of Federalism is relevant to the types of research conducted in the US is that it results in a unusual division of 'state powers' between the federal government and the states.

For example, in general, the criminal law--that is what conduct the government can punish someone for-- is a matter that is left up to the individual states. There are some exceptions of course--mostly in the realm of the Federal government's ability to set policy related to national security-- but generally speaking, the criminal law is not something that is uniform across the various states.

The reason for this is that our constitution establishes a Federal government with limited powers and then the rest of those powers that a government might need to the states. Including what we call the 'police powers' which refers to the power to enact laws that promote the protection of safety, health, morals, prosperity, comfort, convenience and the general welfare of the public. So this means that most of the 'criminal laws' in the U.S. is actually referring to 50+ different sets of laws that may work the same way in some contexts but differently in others. And the primary role of the federal government in the criminal law context is to protect the individual Constitutional or statutory rights that all people in the United States have within these various systems.

Now, if that sounds incredibly and ridiculously complicated and confusing--you would be correct! It is a very confusing system that most people--including people who spent three years in an American law school to become a lawyer-- don't fully understand either. But the key takeaway for all of you should be that the US system of federalism has had a profound influence on the way that the law functions in the US and therefore also the types of research questions that are asked by law-psychology researchers and the willingness of courts and other legal actors to implement ideas and solutions generated from that research.
:::

## 40 Years of Law & Human Behavior

::: columns
::: {.column width="40%"}
![](images/lhbold.jpg){width="312"}
:::

::: {.column .incremental width="60%"}
-   Official journal of APLS
    -   Peer reviewed
    -   Multidisciplinary forum
    -   Range of articles:
        -   original research
        -   reviews
        -   theory papers
:::
:::

::: notes
Which brings us back to the main question we want to answer today: which is what types of law-psychology research is conducted and published in the US? Well as I mentioned before, one of the best ways to try to understand the range of research is to take a deep dive into the articles published in Law and Human Behavior. There are many reasons why it makes sense to focus on this journal: it is the official publication of the American Psychology-Law Society which is the division of APA dedicated to law-psychology.

It is also a great journal because of the quality of editors and reviewers it has in relation to the field. Its focus on encouraging multidisciplinary perspectives and its explicit focus on publishing research that involves the intersection of these two disiplines of law and psychology.

The editorial board members for that first issue represented the following fields outside psychology: sociology, criminology, psychiatry, social ethics, political science, law, and anthropology. From psychology, the editorial board members were from a wide variety of areas including clinical, social, and community psychology.

The journal is also known for being open to publishing different kinds of research. It publishes original experimental work as well as subject area reviews and theoretical or concept papers. In other words, it is probably the most versatile and important journals in the field. But it is by no means the only journal that people go to publish law-psychology research.
:::

