::: notes
Here is a list of many of the other major peer reviewed journals that publish law-psychology research in the U.S. along with their journal impact factor.

The Journal Impact factor is calculated by taking the number of times articles from a particular journal were cited and dividing by the number of scholarly items that could have been cited from all published journals in the previous two years. So the higher the number, the more that journal was circulated and read.

This table can therefore give you an idea of how important Law and human behavior is to the field. The only journals that tend to publish research in law-psychology that have a higher impact factor are journals that not law-psychology focused in the same way. Behavioral and brain science and psychological bulletin publish and American psychologist are forums that mostly publishes articles unrelated to the law. And the Harvard law review is primarily a vehicle for legal scholarship that may or may include an empirical or social sciences component.

Also, as you can see, the impact factor for Law and Human Behavior is currently 3.87. But it was only 2.82 a few years ago when this analysis was conducted. Suggesting that the importance of this journal is only continuing to grow over time.

Can be found at: https://journalimpact.org/
