## Method {background-image="images/file.png" background-opacity="0.1"}

-   Comprehensive review

-   Four research assistants

    -   Overlapped on n = 25%
        -   On average, each coded 450 articles (range: 447-455)
        -   N = 1320 articles from 1977-2014 (vol. 38, issue 3)

-   Removed non-research items

::: notes
So after selecting Law and Human Behavior as the journal to examine for this project, we conducted a comprehensive review of the articles that have been published in its many volumes. To do this we had four research assistants review and code all of the qualifying articles. Also removed articles that were obituaries, editor's notes or introductions, error corrections
:::

## Coded Variables {background-image="images/process.png" background-opacity="0.1"}

::: columns

::: {.column .incremental width="50%"}
-   **General Information**
    -   Research topic(s)
    -   Citations (#)
-   **Research Method**
    -   Sample
    -   Specific research method
-   **Connection to Psychology**
    -   Area of psychology
    -   Application of theory
:::

::: {.column .incremental width="50%"}

-   **Connection to Law**

    -   Area of Law

    -   References to case law

    -   References to statute(s)

    -   References to state or fed constitutions

    -   References to policy

:::
:::

::: notes
Each article was coded for several different types of information but I will focus on a subset of the variables in this presentation because of time. Variables coded included the topic or primary research area for each article (based on 30 categories) and number of citations according to Google Scholar. To do this we used the citation numbers provided by Google scholar because that service captures information from many of the different places where articles can be cited in relevant journals and other outlets.

We also coded for specific research methods such as whether it was a lab study, field study, meta-analysis, survey, interview, observational (14 categories) -- they could be part of more than one category.

We also coded for the specific area of law AND reference to legal doctrine including: reference to case law, reference to statute(s), reference to state or federal constitutional amendment(s), and reference to specific policy. The later 4 variables were coded for level of analysis -- we had 3 levels -- (1) no mention, (2) but only mentions, such as in the literature review, and (3) deeper legal analysis.

Finally, we also coded for connection to psychology -- the specific area of psychology AND reference to psychological theory and the specific theories referenced
:::

