::: notes
Here are the 6 most popular research areas. Together they account for \~60% of the research articles published in 'Law and Human Behavior' during this time.

The largest coded research areas include.... - Witnesses (18%) - defined as anything with in court testimony provided by people with specialized knowledge for one reason or another. This 18% value includes at least three distinct subcategories of witness related research: eyewitness memory (11%), child witnesses (4%) and expert witnesses (4%) that we will take a closer look at in more detail later on. But for now, it is easier to think about all this research within the same category as this topic involves laws of evidence and how courts determine what types of information is relevant or trustworthy in different legal settings.

-   Jury decision-making (15%) - this includes research on both criminal and civil juries.

-   Public policy (9%) -- defined as anything related to analysis of a law or public policy

-   Risk assessment (6%)

-   Mental health/mental illness (9%) - defined as anything with assessment, mental health and crime, including issues related to malingering and psychopathy but notably does not include research on competency, insanity, or risk assessment. It is also worth noting that 4% of this 9% includes papers specifically focused on the psychopathy...but I have combined the two categories today for our convenience as we attempt to grapple with the wide-variety of research topics covered by the field.

-   The final highlighted area of research is Juvenile law (4%) which I believe Dr. Cox talked about at length.

The other 36% of research focused on one or more of the 27 others categories of research topics I refer to as "all other" on this chart.
:::

