::: notes
This "all other" category I included here consists of many important topics that relate to both the criminal and civil legal systems including topics related to police like false confessions, plea bargaining, corrections, sex offenders, probation/reentry/parole, false confessions, plea bargaining, race/ethnicity within the legal system, etc.)

But it is also important to remember that many law-psychology articles cover multiple research topics. For example, some research on the topic of 'risk assessment' may focus primarily on certain specialized like 'sex offenders'. Yet, other research on the topic 'sex offenders' may not cover any issues related to 'risk assessment' and instead focus on the way that probation/reentry/parole policies or civil commitment statutes are applied to cases involving this population.

In other words, because many legal issues are complex and involve multiple areas of the law or target specific populations--research in law-psychology is also (by necessity) similarly complex and multifaceted. Take for example the most topic of 'witnesses' that accounted for 19% of the research articles.
