## Types of "Witnesses" {.incremental}

::: {layout-ncol="3"}
::: {.fragment .fade-in fragment-index="2"}
Child Witnesses \~4% ![](images/child.png)
:::

::: {.fragment .fade-in fragment-index="1"}
![](images/eyewitness.png) Eyewitness Memory \~ 12%
:::

::: {.fragment .fade-in fragment-index="3"}
Expert Witnesses \~4% ![](images/expert.gif)
:::
:::

::: notes
::: notes
We can break this broader category down into at least three large subcategories: eyewitness memory, child witnesses, and expert witnesses.

Eyewitness memory research accounts for the largest percentage of this category (11%) and sometimes looks very different from research on child witnesses or experts witnesses. But not always. For example, child witness research sometimes focuses on the ways that children process, encode and store information. But other research focuses more on the psychological experiences of children who are asked to testify about something in court. Although much of this research focuses on cases involving sensitive topics like child abuse that are primarily issues of criminal law; other research focuses on the role of child witnesses in domestic disputes such as in family law cases or in civil litigation.

The same sort of diversity exists in research on eyewitness memory. Some of this research focuses on how factors like the race of someone or the presence of absence of a weapon might impact the accuracy of peoples memory for an event. But in other cases, such as the scientific review paper I mentioned earlier, researchers are focused more on how specific procedures and practices within the court system impact things like the rights of criminal defendants or the decisions made by judges and juries as fact-finders.

Meanwhile "expert" witnesses play an entirely differently role in the U.S legal system. Their primary function is to supply courts and fact-finders like juries and judges with 'specialized' knowledge that regular folks without domain-specific expertise need in a particular case. This area of 'witness' research is one where those distinction between federal and state law and civil versus criminal law creates lots of confusion. The federal court system has an entirely different set of rules and procedures for qualifying an expert or evaluating their testimony than some of the states. Whereas other states just choose to replicate the federal way of doing things. This sort of built-in variation within the law impacts the types of questions that law-psychology researchers ask and explore in their work.

But another factor that has influenced the popularity of certain research topics is time.
