::: notes
In summary, we found that even though Law and Human Behavior has published articles about a wide-variety of research areas -- the vast majority of published articles have focused on a few narrow topics that are relevant to U.S. law. For instance, almost 30% of all articles published over this 40 year period covered one of two topics: eyewitness memory or jury decision making.

Similarly, we also found that certain areas of the law were vastly over represented: in particular, most articles focused on the criminal law.

We also see there is room for growth in the areas of psychology that we apply to the research -- developmental psychology and neuro psychology are both good examples.

Together this all suggests that there is a need for the field of law-psychology to expand into new and different areas of research. In fact, for decades leaders of AP-LS have been calling for the field to expand--especially in terms of the legal topics it focuses on. Given that any law that attempts to control behavior is appropriate for empirical analysis. There is a need for U.S. law-psychology researchers to expand to other areas of law that have a significant impact on people's daily lives. Including family law, the law of contracts, property law and even more specialized topics that span across different systems like public health law.
:::

